func TestKochCurve(t *testing.T) {
	for _, testcase := range kochCurveTests {
		t.Log(testcase.name)

		buf.Reset()
		r := strings.NewReader(testcase.text)
		if result := answer(r); !reflect.DeepEqual(result, testcase.want) {
			t.Errorf("result => %#v,\n want => %#v", result, testcase.want)
		}
	}
}

var result string

func BenchmarkKochCurve(b *testing.B) {
	var str string
	for i := 0; i < b.N; i++ {
		for _, testcase := range kochCurveTests {
			b.StopTimer()
			buf.Reset()
			r := strings.NewReader(testcase.text)
			b.StartTimer()
			str = answer(r)
		}
	}
	result = str
}
